B.ark=new A.ib("I","Olfactory","Olfactory receptor neurons in the olfactory epithelium (roof of nasal cavity).","Olfactory bulb \u2192 olfactory tract \u2192 primary olfactory cortex (piriform cortex), amygdala, entorhinal cortex.","Fila olfactoria pass through foramina in the cribriform plate of the ethmoid to synapse in the olfactory bulb; fibers continue as the olfactory tract and striae to the olfactory cortex.","Multiple small olfactory filaments (fila olfactoria). Functionally divides into olfactory striae (medial/lateral).")
B.arg=new A.ib("II","Optic","Retinal ganglion cells (axons form the optic nerve).","Lateral geniculate body (major); also fibers to superior colliculus, pretectal area, and suprachiasmatic nucleus.","Optic nerve \u2192 optic canal \u2192 optic chiasm (partial decussation) \u2192 optic tract \u2192 lateral geniculate body \u2192 optic radiations to visual cortex.","No peripheral branches. Collaterals project to pretectal area (light reflex), superior colliculus, and hypothalamus (circadian).")
B.aro=new A.ib("III","Oculomotor","Oculomotor nucleus and Edinger\u2013Westphal nucleus in the midbrain (level of superior colliculus).","Motor to SR, IR, MR, IO, levator palpebrae superioris; parasympathetic to ciliary ganglion \u2192 sphincter pupillae and ciliary muscle.","Emerges from interpeduncular fossa \u2192 passes between PCA and SCA \u2192 lateral wall of cavernous sinus \u2192 superior orbital fissure (within common tendinous ring) \u2192 divides into superior and inferior divisions in the orbit.","Superior division: levator palpebrae superioris, superior rectus.\nInferior division: medial rectus, inferior rectus, inferior oblique + parasympathetic root to ciliary ganglion.")
B.arj=new A.ib("IV","Trochlear","Trochlear nucleus in the midbrain (level of inferior colliculus).","Superior oblique muscle.","Only CN to exit dorsally: fibers decussate and emerge below inferior colliculus \u2192 wraps around midbrain \u2192 lateral wall of cavernous sinus \u2192 superior orbital fissure (outside common tendinous ring) \u2192 superior oblique.","Single terminal branch to superior oblique.")
B.arf=new A.ib("V","Trigeminal","Sensory nuclei (mesencephalic, principal sensory, spinal trigeminal) and motor nucleus of trigeminal in the pons.","General sensation from face, cornea, nasal/oral cavities, anterior 2/3 tongue (general); motor to muscles of mastication + mylohyoid, anterior belly digastric, tensor tympani, tensor veli palatini.","Emerges from lateral pons \u2192 trigeminal (Gasserian) ganglion in Meckel\u2019s cave \u2192 divides into V1 (SOF), V2 (foramen rotundum), V3 (foramen ovale). Motor root joins V3.","V1 (ophthalmic): lacrimal, frontal, nasociliary.\nV2 (maxillary): infraorbital, zygomatic, posterior/middle/anterior superior alveolar, greater/lesser palatine, nasopalatine.\nV3 (mandibular): auriculotemporal, buccal, lingual, inferior alveolar (\u2192 mylohyoid), masseteric, deep temporal, nerves to pterygoids.")
B.arn=new A.ib("VI","Abducens","Abducens nucleus in the pons (floor of 4th ventricle, facial colliculus).","Lateral rectus muscle.","Emerges at pontomedullary junction \u2192 ascends along clivus \u2192 Dorello\u2019s canal \u2192 cavernous sinus (close to internal carotid artery) \u2192 superior orbital fissure (within common tendinous ring) \u2192 lateral rectus.","Single terminal branch to lateral rectus.")
B.ari=new A.ib("VII","Facial","Facial motor nucleus, superior salivatory nucleus, and nucleus solitarius pathways in the pons.","Motor to muscles of facial expression, stapedius, stylohyoid, posterior belly digastric; parasympathetic to lacrimal, submandibular & sublingual glands; taste from anterior 2/3 tongue.","Cerebellopontine angle \u2192 internal acoustic meatus \u2192 facial canal (geniculate ganglion) \u2192 exits stylomastoid foramen \u2192 passes through parotid gland forming parotid plexus \u2192 terminal branches to face.","In facial canal: greater petrosal nerve, nerve to stapedius, chorda tympani.\nAfter stylomastoid foramen: posterior auricular; branches to stylohyoid and posterior belly of digastric; terminal parotid plexus: temporal, zygomatic, buccal, marginal mandibular, cervical.")
B.are=new A.ib("VIII","Vestibulocochlear","Cochlear division: spiral ganglion (cochlea). Vestibular division: vestibular (Scarpa) ganglion.","Cochlear and vestibular nuclei at the pontomedullary junction; higher centers via auditory/vestibular pathways.","Travels from inner ear through internal acoustic meatus to brainstem; cochlear fibers enter cochlear nuclei, vestibular fibers enter vestibular nuclei.","Cochlear nerve + vestibular nerve (often described as superior and inferior vestibular divisions).")
B.arm=new A.ib("IX","Glossopharyngeal","Nucleus ambiguus (motor), inferior salivatory nucleus (parasympathetic), nucleus solitarius (taste), spinal trigeminal nucleus (sensory) in the medulla.","Stylopharyngeus; parotid gland (via otic ganglion); taste & sensation posterior 1/3 tongue; carotid sinus/body; mucosa of oropharynx and middle ear.","Exits jugular foramen \u2192 descends between internal carotid artery and internal jugular vein \u2192 winds around stylopharyngeus \u2192 distributes to pharynx and posterior tongue; gives tympanic branch to middle ear.","Tympanic (Jacobson) \u2192 lesser petrosal; carotid sinus nerve; stylopharyngeal branch; pharyngeal branches; tonsillar branches; lingual branches.")
B.ard=new A.ib("X","Vagus","Nucleus ambiguus (motor), dorsal motor nucleus of vagus (parasympathetic), nucleus solitarius (taste/visceral), spinal trigeminal nucleus (somatic sensory) in the medulla.","Motor to palate/pharynx/larynx; parasympathetic to heart, lungs, and GI tract to left colic flexure; visceral sensory from thoracoabdominal organs.","Exits jugular foramen \u2192 carotid sheath in neck \u2192 gives pharyngeal and laryngeal branches \u2192 enters thorax (cardiac/pulmonary/esophageal plexuses) \u2192 through esophageal hiatus as vagal trunks \u2192 abdominal viscera.","Meningeal, auricular (Arnold), pharyngeal, superior laryngeal (internal/external), recurrent laryngeal, cardiac branches, pulmonary branches, esophageal branches, gastric branches.")
B.arh=new A.ib("XI","Accessory","Spinal accessory nucleus (C1\u2013C5) for spinal part; cranial part arises from nucleus ambiguus (often considered part of vagus functionally).","Sternocleidomastoid and trapezius (spinal part). Cranial part joins vagus to supply palate/pharynx/larynx muscles.","Spinal rootlets ascend through foramen magnum \u2192 exit skull via jugular foramen \u2192 spinal part crosses posterior triangle of neck to trapezius; cranial part merges with vagus soon after the jugular foramen.","Muscular branches to SCM and trapezius; communicates with cervical plexus (C2\u2013C4) for proprioception/sensory.")
B.arl=new A.ib("XII","Hypoglossal","Hypoglossal nucleus in the medulla.","Intrinsic and extrinsic tongue muscles (except palatoglossus). Also carries C1 fibers to geniohyoid and thyrohyoid.","Exits hypoglossal canal \u2192 descends between internal carotid artery and internal jugular vein \u2192 loops forward deep to posterior belly of digastric/stylohyoid \u2192 passes deep to mylohyoid \u2192 enters tongue.","Muscular branches to tongue. C1 fibers hitchhike: superior root of ansa cervicalis (descendens hypoglossi) and nerve to thyrohyoid/geniohyoid.")
B.a7a=new A.bN(B.a8B,[B.ark,B.arg,B.aro,B.arj,B.arf,B.arn,B.ari,B.are,B.arm,B.ard,B.arh,B.arl],A.ak("bN<j,ib>"))
